import styled from "styled-components";

export const TableStyled = styled.table`
  width: 500px;
  margin-top: 20px;
  margin-left: auto;
  margin-right: auto;

  border: 2px solid white;
  border-radius: 20px;
  box-shadow: 0px -5px 10px white;
`;
export const TheadStyled = styled.thead`
  background-color: gray;
`;
